  false,\n\t\"url\": null,\n\t\"notes\": \"The Vieux Carru00e9 shall have for its
  purpose the preservation of such buildings in the Vieux Carru00e9 section of the
  city as, in the opinion of the Vieux Carru00e9 Commission, shall have architectural
  and historical value and which should be preserved for the benefit of the people
  of the city and state. The Vieux Carru00e9 section of the city is hereby defined
  to comprise all that area within the city limits within the following boundaries:
  the river, uptown side of Esplanade Avenue, the riverside of Rampart Street and
  the lower side of Iberville Street. (Code 1956, u00a7 65-6)\",\n\t\"license_title\":
